import data from './data'

function App() {
  return (
    <div className="App">
      <h1>Pokedex</h1>
      <div> {/* Javascript coloca entre { } */}
        {data.map(element =>  
          <div key={element.id}>
            <div>
              <h2>name: {element.name}</h2>
              <h3>type: {element.type}</h3>
            </div>
            <img src={element.image} alt={element.name}/>
          </div>)}
      </div> 
    </div>
  );
}

export default App;
